import React from "react"
import { incrementTime } from "../../redux/time/time.actions"
import { connect } from "react-redux"

const TimeKeeper = ({ incrementTime }) => {
  const startTime = () => {
    console.log("starting time")
  }
  return (
    <div>
      <button onClick={this.startTime}>Start Time</button>
    </div>
  )
}

const mapDispatchToProps = (dispatch) => ({
  incrementTime: (time) => dispatch(incrementTime(time)),
})

export default connect(mapDispatchToProps)(TimeKeeper)
